import Header from './components/Header';
import SubHeader from "./components/SubHeader";
import Form from "./components/Form";
import './App.css';

function App(){
  return(
     <>
     <Header/>
     <SubHeader/>
     <div className="row">
         <Form/>
         Hello
     </div>
     </>
  );
}

export default App;
